import { Component, Inject } from '@angular/core';
import { SubscribeService } from '../../../Services/subscribe.service';
import { UserService } from '../../../Services/user.service';

@Component({
  selector: 'app-user-list',
  templateUrl: './user-list.component.html',
  // providers: [SubscribeService]
  providers: [SubscribeService]
})
export class UserListComponent {
  constructor(private subscribeService: SubscribeService,private userservice : UserService) {}
  OnSubscribe(){
      this.subscribeService.OnSubscribeClicked('User List');
   }
   userlist = this.userservice.getAllUsers();
}
<div class="admin-user-list">
    <div class="admin-user-detail" *ngFor="let user of userlist">
        <div class="admin-user-name">{{user.name}}</div>
        <div class="admin-user-gender">{{user.gender}}</div>
        <div class="admin-user-subtype">{{user.subscriptionType}}</div>
        <div class="admin-user-active">{{user.status}}</div>
        <button class="admin-user-show-detail-button">+</button>
    </div>   
</div>
